insert into plats (id, nom, prix, description, fichier, categorie_id, created_at, updated_at ) values (1, 'sauce graine', 12, 'La sauce graine, aussi appelée « Palm nut Soup » est un incontournable de la cuisine africaine. Cette sauce peut être réalisée avec du bœuf, de l’agneau, du poulet, des crabes ou du poisson fumé. ', 'saucegraine.jpeg', 2, '2022-12-13 13:43:29', '2023-08-04 21:38:20');
