insert into plats (id, nom, prix, description, fichier, categorie_id, created_at, updated_at ) values (7, 'Corn Chaff', 12, 'Le corn chaff est un delicieux ragoût  utilisant du maïs et des haricots (rouge ou noir) comme ingrédients clés. Le maïs et les haricots sont lentement mijotés avec des ingrédients tels que des oignons, de l’huile de palme, des tomates, diverses épices et  du poisson fumé, ou de la viande ', 'CORNCAF.jpg', 3, '2022-10-11 04:40:01', '2023-04-18 16:38:18');
